  if (!isSelf) {
    if (peerInfo.call.status === SkylinkDemo.CALL_STATUS.REQUEST_CALL) {
      var result = confirm('Do you want to accept the call?');
      SkylinkDemo.acceptRequestCall(peerId, result);
