SkylinkDemo.joinRoom('room');

// Example 3: Join a room with audio only
SkylinkDemo.joinRoom('room', {
  'audio' : true,
  'video' : false
});

// Example 4: Join a room with prefixed video width and height settings
SkylinkDemo.joinRoom('room', {
  'audio' : true,
  'video' : {
    'resolution' : {
      'width' : 640,
      'height' : 320
    }
  }
});

